construction of a 20km branch line from cottonvale to amiens commenced in 1919. 
the line was opened on 7 june 1920, and operated for more than 50 years. the line was closed 28 february 1974.
this former railway line serviced the towns of amiens, messines, bapaume, passchendaele, bullecourt, pozieres, and fleurbaix. 
soldiers returning from the first world war were granted agricultural land in this region, and the railway line was designed to serve as a transport for fruit from the orchards to markets in brisbane and sydney.
all the stations along the line were named after battlegrounds on the western front during the first world war.
the amiens line was the highest in southern queensland, with the railway reaching an elevation of 946 metres above sea level at pozieres.
with the closure of the amiens branch line, the summit became the highest remaining railway station in queensland, at 923.5m above sea level.
the nameboards of these former stations also show their elevation above sea level, measured in feet.
